import React, { useEffect, useState } from 'react';

const Escritorio = () => {
    const [triajeData, setTriajeData] = useState([]);
    const [planData, setPlanData] = useState([]);

    useEffect(() => {
        const token = localStorage.getItem('token');

        const fetchData = async () => {
            try {
                const triajeResponse = await fetch('http://localhost:3002/api/escritorio/listarTriaje', {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });
                const triajeData = await triajeResponse.json();
                setTriajeData(triajeData);

                const planResponse = await fetch('http://localhost:3002/api/escritorio/listarPlan', {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });
                const planData = await planResponse.json();
                setPlanData(planData);
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <div>
                <h2>Triaje</h2>
                <table>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Paciente</th>
                    </tr>
                    </thead>
                    <tbody>
                    {triajeData.map((item, index) => (
                        <tr key={item.idatencion}>
                            <td>{index + 1}</td>
                            <td>{item.paciente}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
            <div>
                <h2>Atenci√≥n</h2>
                <table>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Paciente</th>
                    </tr>
                    </thead>
                    <tbody>
                    {planData.map((item, index) => (
                        <tr key={item.idatencion}>
                            <td>{index + 1}</td>
                            <td>{item.paciente}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Escritorio;
